import React from 'react';
import Grid from '@material-ui/core/Grid';
import Button from '@material-ui/core/Button';
import './Header.css';

const ColorButton = withStyles((theme: Theme) => ({
  root: {
    color: theme.palette.getContrastText(purple[500]),
    backgroundColor: purple[500],
    '&:hover': {
      backgroundColor: purple[700],
    },
  },
}))(Button);

export default function Header() {
    return (
        <Grid container spacing={0} className="grid">
            <Grid item xs={12} sm={6} className="images">
                <img src="/images/MathLaw.PNG"></img>
                <img src="/images/logo.PNG" style={{marginBottom: "33px", marginLeft: "30px"}}></img>
            </Grid>
            <Grid item xs={12} sm={6}>
                <Button className="topssignUp">Sign Up</Button>
                <Button className="toplogIn">Log In</Button>
            </Grid>
        </Grid>
    );
}
